const rows = uiLogic.grid.state.rows;
if (rows && rows.length > 0) {
	rows.forEach(row => {
		const titleColumn = row.uiActionGroupStates.target_title;
		const review_state = row.data.review_data.state;
		if (titleColumn && Object.values(titleColumn).length > 0) {
			Object.values(titleColumn).forEach(action => {
				if (action.uiActionId === 'remove_case@review_content') {
					action.visible = review_state == '10';
				}
                if(action.uiActionId === 'remove_case@review_content' && context.srfreadonly ==true){
                    action.visible = false;
                }
			})
		}
        row.editColStates.change_type.disabled = review_state == '60';
        row.editColStates.change_version.disabled = review_state == '60';
        row.editColStates.change_version.readonly = review_state == '60';
        row.editColStates.change_version.editable = review_state == '60';
	})
}

const total = uiLogic.ctrl.state.total;
const rows = uiLogic.grid.state.rows;
uiLogic.view.layoutPanel.state.data.total = rows.length;
if (rows && rows.length > 0) {
    let total_already = 0;
    rows.forEach(row => {
        const state = row.data.final_stage_results;
    if (state !== null && state !== undefined) {
        total_already++;
    }
    });
    uiLogic.view.layoutPanel.state.data.total_already = total_already;
    const floatTotal = parseFloat(rows.length);
    const floatTotalAlready = parseFloat(total_already);
    const ratio = Math.round((floatTotalAlready / floatTotal) * 100); 
    uiLogic.view.layoutPanel.state.data.schedule = ratio;
} else {
    uiLogic.view.layoutPanel.state.data.total_already = 0;
    uiLogic.view.layoutPanel.state.data.schedule = 0;
}

const appDataEntityId = 'plmweb.review_content';
const context = uiLogic.ctx;
const data_arr = uiLogic.default;

const keyMapping = {
    srfkey: 'target_id',
};

const propertyMap = uiLogic.view.model.appViewParams?.find(
    item => item.key.toLowerCase() === 'PROPERTYMAP'.toLowerCase(),
);

if (propertyMap) {
    const keyValuePairs = propertyMap.value.split(',');
    // 遍历键值对数组并添加到 keyMapping 映射对象中
    for (const pair of keyValuePairs) {
        const [sourceKey, targetKey] = pair.split(':');
        if (sourceKey && targetKey) {
            keyMapping[sourceKey] = targetKey;
        }
    }
}

// *转换属性
const addData = data_arr.map(item => {
    const tempData = {};
    // 遍历映射对象，将属性从 item 复制到 tempData
    Object.keys(keyMapping).forEach(key => {
        const targetKey = keyMapping[key];
        tempData[targetKey] = item[key];
    });
    // 获取 change_version 中 from 对象的 owner_type
    const ownerType = context.principal_type.toUpperCase();
    // 将 target_type 字段设置为 owner_type
    tempData['target_type'] = ownerType;
    keyMapping['srfkey'] = item['id'];
    return tempData;
});

// 获取实体服务并调用创建接口
const service = ibiz.hub.getApp(context.srfappid).deService;
service.exec(appDataEntityId, 'Create', context, addData);

const review_content = uiLogic.review_content;
const content_version = review_content.change_version;


if(content_version && content_version.length >0){
    content_version.forEach((c_version, index) => {
        if(c_version.srflistmapfield == 'from'){
            review_content.base_version = c_version.id;
        }
        if(c_version.srflistmapfield == 'to'){
            review_content.compare_version = c_version.id;
        }
    })

}
